const emailValidation = $json.result?.validation_details || {};
const emailStatus = ($json.result?.status || "").toLowerCase();

// Email validation: must pass format, MX, and SMTP check, and status must be deliverable
const emailValid = emailValidation.format_valid === true &&
                   emailValidation.mx_found === true &&
                   emailValidation.smtp_check === true &&
                   emailStatus === "deliverable";

// Risky email flags
const emailRisky = emailValidation.catch_all === true ||
                   emailValidation.disposable === true ||
                   emailValidation.free === true ||
                   emailValidation.role === true;

// Phone validation: must be valid and either mobile or fixed_line
const phoneValid = $json.valid === true &&
                   $json.line_type_intelligence &&
                   ["mobile", "fixed_line"].includes($json.line_type_intelligence.type);

// Determine status
let status = "";
if (emailValid && phoneValid) {
  status = "valid";
} else if (!emailValid && phoneValid) {
  status = "invalid-email";
} else if (emailValid && !phoneValid) {
  status = "invalid-phone";
} else if (!emailValid && !phoneValid) {
  status = "invalid-contact";
}

// Return structured result
return [
  {
    phone_number: $json.phone_number || null,
    email: $json.result?.email_address || null,
    phoneValid,
    emailValid,
    emailRisky,
    validationStatus: status
  }
];
